    return ( <
        View style = {
            { flex: 1, backgroundColor: "#1a1a1a" } } >
        <
        Homebar navigation = { navigation }
        /> <
        ScrollView style = {
            { flex: 1 } } >
        <
        Text style = {
            { textAlign: "center", fontSize: 30, color: "#fff" } } > Friend Page < /Text> <
